import React, { Component } from 'react';

export default class Landing extends Component {
  render() {
    return (
      <div className="landing">
        <div className="container">
          <h1 className="header">
            Ramzi El-Ramahi 
          </h1>
          <h3>Software Developer</h3>
        </div>
      </div>
    )
  }
}
